(1,'2018-08-14 17:10:47',NULL,NULL,545,545,'99-5000  KN清洗喷雾套装【易燃品！不发快递，只能发物流】',11000,9000,7500,1112,66590,'http://www.51jiyou.com/upload/upload/39.jpg',0,'<p> <a href=\"http://www.knfilters.com/search/product.aspx?prod=99-5000\" target=\"_blank\">官网介绍http://www.knfilters.com/search/product.aspx?prod=99-5000</a></p> <p> &nbsp;</p> <p> <img alt=\"\" src=\"http://www.51jiyou.com/include/js/ckfinder/userfiles/images/2013/09/20130922_2032268281.jpg\" style=\"width: 718px; height: 504px;\" /></p> <p> 清洗方法如下： 1,将风格从空气滤槽中取出。 2,使用软毛刷将风格表面上的污垢扫除。 3,清除表面污垢后,用护理套装中的清洗剂(CLEANER),均匀喷洒于滤芯表面,只要覆盖均匀就好。 4,喷完后,将滤芯摆放于阴凉处,等待清洗液渗透。 5,大约10分钟,使用清水冲洗风格,从干净的一面往脏的一面冲掉污垢（注意只能使用普通自来水清洗,绝对不能使用高压水枪）。 6,冲洗后,可以手握风格甩掉大部分水,然后放置于阴凉处晾干（不能使用高压空气）。 7,晾干后,使用套装中的护理油(FILTER OIL)补充油份。将护理油喷洒于外层表面,均匀即可。 8,将附有护理油的风格晾干后,装回原车即可。</p> ',NULL,NULL,908,'PCS',99,0,0,0),
(2,'2018-08-14 17:10:47',NULL,NULL,690,592,'巨犀牌半自动变速箱清洗循环换油机 (电动)',220000,195000,179200,0,11,'http://www.51jiyou.com/upload/upload/product/58.jpg',0,'<p> &nbsp;</p> <p> &nbsp;</p> <p> <img alt=\"\" src=\"http://www.51jiyou.com/include/js/ckfinder/userfiles/images/2014/04/20140402_1713127029.jpg\" style=\"width: 582px; height: 753px\" /></p> <p> <strong>一、ATF-20D自动变速箱油更换机功能</strong></p> <p> 自动变速箱构造极其严密复杂，传统换油方式一般只能换油25%，而金属屑、油泥等仍残留在变速箱内与新油混合后造成变速箱的再次污染，使变速箱加速迟钝，变档振动，进而过热、耗油等异常现象发生，若置之不理，就很容易发生故障。</p> <p> 汽车自动变速箱油更换机,根据汽车自动变速箱油本身的循环冷却压力与本系统的输出压力,在旧油输出的同时将新油注入自动变速箱内，这种进出油同步进行的循环换油方式不仅保证自动变速箱换油安全、高效，而且使其得到彻底保养，同时本更换机采用可调压力设计,可根据不同车型调节所需压力，操作简单、方便。</p> <p> <img alt=\"\" src=\"http://www.51jiyou.com/include/js/ckfinder/userfiles/images/2014/04/20140402_1716568877.jpg\" style=\"width: 432px; height: 320px\" /></p> <p align=\"center\"> &nbsp;</p> <p> 1、加油口&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;6、过滤器&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 11、旧油视窗&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p> <p> 2、回油压力表&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;7、出油口&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;12、转换阀1</p> <p> 3、AIR接口&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;8、回油口&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;13、调压阀 &nbsp;&nbsp;&nbsp;重&nbsp;&nbsp;&nbsp; 量：31 Kg</p> <p> 4、外部吸油接头 &nbsp;&nbsp;9、出油压力表 &nbsp;&nbsp;&nbsp;&nbsp;14、旧油桶&nbsp; &nbsp;&nbsp;外形尺寸：长&nbsp; 宽&nbsp; 高</p> <p> 5、转换阀2&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;10、新油视窗 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 15、新油桶 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;单位（mm）:435 /365/ 935</p> <p> &nbsp;</p> <p> &nbsp;</p> <p> &nbsp;</p> <p> &nbsp;</p> <p> <img alt=\"\" src=\"http://www.51jiyou.com/include/js/ckfinder/userfiles/images/2014/04/20140402_1717138338.jpg\" style=\"width: 533px; height: 342px\" /></p> <p> <strong>清洗机配备</strong></p> <p> <strong>机器组件：</strong></p> <p> 本机在出厂时已包装好以防通常的运输损坏，但仍不能避免异常或事故。请仔细检查任何可能的损坏，如有损坏，建议拍上照片，写下书面文件为证据一并报给运输商。在你订购的自动变速箱油更换清洗机中包含：</p> <p> &nbsp;</p> <p> 1、自动变速箱油更换清洗机主机一台；</p> <p> 2、自动变速箱油更换清洗机配件；</p> <p> a.轮子4个&nbsp; b.M8螺丝16个（固定轮子用）&nbsp; c.进回油管一套&nbsp; d.说明书。</p> <p> 3、专用接头一套。</p> <p> <img alt=\"\" src=\"http://www.51jiyou.com/include/js/ckfinder/userfiles/images/2016/12/20161207_1554055894.png\" style=\"width: 535px; height: 703px;\" /></p> <p> <strong>专用清洗液配备包括（需另购）</strong></p> <p> 1、每箱24支，每支1升。</p> <p> 注：每支可清洗一辆车。</p> <p> <strong>三、操作前准备</strong></p> <p style=\"margin-left: 27.45pt\"> 1、将适量的新自动变速箱油加入清洗换油机新油储油桶内（约１２公升）（也可使用外部容器之新油,将透明连接管插入外部容器中将转换&ldquo;转换阀2&rdquo; 箭头指向&ldquo;FILLING&rdquo;位置)；</p> <p style=\"margin-left: 20.6pt\"> 2、将空压气管与本机AIR连接，将&ldquo;转换阀2&rdquo; 箭头指向至&ldquo;RECYCLE&rdquo;处,将透明短管接至排油口&ldquo;PRESSURE&rdquo;处,开启调压阀,直至有新油流出 ；(此步骤为排除清洗换油机内部之空气所必须)；</p> <p> 3、使用举升机将汽车顶起，并准备好清洗液。</p> <p> <strong>四、操作步骤</strong></p> <p> <strong>（一）、循环清洗</strong></p> <p> 1、确认汽车处于刹车状态；</p> <p> 2、找出汽车上便于拆装的ATF冷却油管,拆下接头；</p> <p style=\"margin-left: 20.6pt\"> 3、短暂启动引擎,判断两端出油与入油方向；出油端接上球阀后与本机右侧回油&ldquo;RETURN&rdquo;接头相连,将进油端直接与本机右侧出油&ldquo;PRESSURE&rdquo;接头相连；</p> <p style=\"margin-left: 20.6pt\"> 4、从工具箱中找出合适的接头分别将清洗机换油进回油管与拆下的冷却油管两端相连；</p> <p style=\"margin-left: 20.6pt\"> 5、将本机配备的透明短管与外部吸油&ldquo;FILLING&rdquo;接头10相连；将透明短管另一端插入清洗液中；</p> <p> 6、将车顶高,因为每一动力档位均需运作；</p> <p style=\"margin-left: 20.6pt\"> 7、确认空压机接于&ldquo;AIR&rdquo;接头,将本机的转换阀&ldquo;2&rdquo; 箭头指向吸油&ldquo;FILLING&rdquo;位置,转换阀&ldquo;1&rdquo; 箭头&nbsp;指向换油&ldquo;PRESSURE&rdquo;位置；</p> <p style=\"margin-left: 20.6pt\"> 8、开启调压阀(&ldquo;+&rdquo;方向为增大流量,&ldquo;-&rdquo;方向为减少流量),调压到约40PSI.此时清洗液即被打入变速箱内；</p> <p style=\"margin-left: 20.6pt\"> 9、待清洗液完全打入后,拆下透明短管.将本机转换阀&ldquo;2&rdquo; 箭头指向&ldquo;FILLING&rdquo;位置,转换阀&ldquo;1&rdquo; 箭头指向循环&ldquo;RECYCLE&rdquo;位置，关闭调压阀；</p> <p style=\"margin-left: 20.6pt\"> 10、启动引擎,此时本机便处于循环清洗状态,可从新旧油视窗观察到旧油的流动,逐一档位循环切换约停留5-10秒，5分钟后,清洗完毕,关闭引擎。</p> <p> <strong>（二）、循环换油</strong></p> <p> 1、连接方法,请参阅上述&ldquo;循环清洗&rdquo;第1-7条；</p> <p style=\"margin-left: 20.6pt\"> 2、确认本机内新油桶加入约12公升的自动变速箱油,将转换阀&ldquo;2&rdquo; 箭头指向循环&ldquo;RECYCLE&rdquo;的位置 (如果使用外部新油,则将透明连接管接到外部吸油接头,转换阀&ldquo;2&rdquo; 箭头指向吸油&ldquo;FILLING&rdquo;)；</p> <p style=\"margin-left: 20.6pt\"> 3、将本机转换阀&ldquo;1&rdquo; 箭头指向换油&ldquo;PRESSURE&rdquo;的位置,开启本机调压阀(&ldquo;+&rdquo;方向为增大流量&ldquo;-&rdquo;为减小流量），先调压至约60PSI，开始向变速箱内注新油，待新油视窗有油流动时启动引擎，自动变速箱开始新旧油交换；</p> <p style=\"margin-left: 20.6pt\"> 4、新油视窗&ldquo;NEWOIL&rdquo;5,旧油视窗&ldquo;USEDOIL&rdquo;4，根据两视窗内新旧油流量或新旧油桶的进出油量作对比,可随时调节压力大小；</p> <p style=\"margin-left: 20.6pt\"> 5、当压力调节到80PSI以上,如果新油仍比旧油流动慢,此时需使用回油管上的球阀控制,减小旧油流量,以确保新旧油进出平衡；</p> <p> 6、在新旧油交换时,每一档循序切换,视情况而定,约需停留5-10秒钟；</p> <p style=\"margin-left: 20.6pt\"> 7、注意观察旧油视窗油颜色的变化,当旧油视窗内波箱油的颜色由污浊转变到与新油同一颜色时,表示新旧油交换完毕，立即关闭引擎；</p> <p style=\"margin-left: 20.6pt\"> 8、恢复自动变速的油管,发动引擎,将变速箱档位换至P档,视油位补充ATF油,同时注意检查各管路是否渗漏油,油位足够后,试车约一公里再检视一次。</p> <p> <strong>六、注意事项</strong></p> <p> 1、注意出油管,回油管与自动变速箱油管正确连接法；</p> <p> 2、清洗时注意各接头是否漏液,如有泄漏须停机重新安装；</p> <p> 3、定期(2-3天)排放空压机水份,以免过多的水份进入泵浦引起故障；</p> <p> 4、如发现系统工作有异常请立刻停机检查,并立即与经销商联系。</p> <p> <strong>七、ATF-20D自动变速箱油更换机的其它功能</strong></p> <p> 1、本机内部废油排出方法:</p> <p style=\"margin-left: 34pt\"> （1）将本机转换阀&ldquo;2&rdquo; 箭头指向&ldquo;FILLING&rdquo;吸油位置,转换阀&ldquo;1&rdquo; 箭头指向&ldquo;PRESSURE&rdquo;换油位置；</p> <p> （2）透明连接管连接主机右侧回油&ldquo;RETURN&rdquo;接头13连接吸油&ldquo;FILLING&rdquo;接头10；</p> <p> （3）在出油&ldquo;PRESSURE&rdquo;接头12接上油管,油管前端接上配套的接头,放入废油桶；</p> <p> （4）将调压阀调压至60PSI的位置即可。</p> <p> 2、本机自外部油桶循环换油方式:</p> <p> （1）将转换阀&ldquo;1&rdquo; 箭头指向换油&ldquo;PRESSURE&rdquo;,转换阀&ldquo;2&rdquo; 箭头指向吸油&ldquo;FILLING&rdquo;；</p> <p style=\"margin-left: 34.3pt\"> （2）将透明连接管,一端接于主机右侧吸油&ldquo;FILLING&rdquo;接头10,另一端置于外部新油桶内；</p> <p> 3、连接自动变速箱油管,方法如&ldquo;循环清洗&rdquo;所述；</p> <p style=\"margin-left: 20.6pt\"> 4、开启调压阀&ldquo;8&rdquo;先调压至60PSI后，新油经透明管吸上,由出油管注入自动变速箱内；</p> <p style=\"margin-left: 20.6pt\"> 5、此后操作步骤与&ldquo;循环换油&rdquo;所述之操作方式相同。</p> <p style=\"margin-left: 20.6pt\"> &nbsp;</p> <p> &nbsp;</p> <p> &nbsp;</p> ',NULL,NULL,40000,'PCS',99,0,0,0),
