(32,'2018-08-14 17:10:47',NULL,NULL,473,469,'【易燃品！不发快递，只能发物流】安索S2000辛烷值提升剂(AOBBE)--354毫升装',12000,10000,6000,745,23579,'http://www.51jiyou.com/upload/upload/product/146.jpg',0,'<p> <span style=\"color: rgb(0, 0, 0); font-family: arial, 宋体; line-height: 19px; orphans: 2; text-align: -webkit-auto; widows: 2;\">PI适用范围最广，去积碳效果最好。一瓶最多可以对80L油，小排量的车一次可以用半瓶。</span><br style=\"color: rgb(0, 0, 0); font-family: arial, 宋体; line-height: 19px; orphans: 2; text-align: -webkit-auto; widows: 2;\" /> <span style=\"color: rgb(0, 0, 0); font-family: arial, 宋体; line-height: 19px; orphans: 2; text-align: -webkit-auto; widows: 2;\">AGA是给直喷发动机设计的添加剂，适合长期适用。类似快乐跑。一瓶最多60L油。</span><br style=\"color: rgb(0, 0, 0); font-family: arial, 宋体; line-height: 19px; orphans: 2; text-align: -webkit-auto; widows: 2;\" /> <span style=\"color: rgb(0, 0, 0); font-family: arial, 宋体; line-height: 19px; orphans: 2; text-align: -webkit-auto; widows: 2;\">AQS是乙醇汽油使用，适合去汽油的水。还是摩托车去积碳，推荐的添加剂。</span><br style=\"color: rgb(0, 0, 0); font-family: arial, 宋体; line-height: 19px; orphans: 2; text-align: -webkit-auto; widows: 2;\" /> <span style=\"color: rgb(0, 0, 0); font-family: arial, 宋体; line-height: 19px; orphans: 2; text-align: -webkit-auto; widows: 2;\">AST是汽油稳定剂，是适合那种长时间不用的车，防止汽油氧化。</span><br style=\"color: rgb(0, 0, 0); font-family: arial, 宋体; line-height: 19px; orphans: 2; text-align: -webkit-auto; widows: 2;\" /> <span style=\"color: rgb(0, 0, 0); font-family: arial, 宋体; line-height: 19px; orphans: 2; text-align: -webkit-auto; widows: 2;\">S2000是提高辛烷值，改装车用的多。比赛加这个会很猛</span></p> ',NULL,NULL,354,'PCS',99,0,0,0),
