(86,'2018-08-14 17:10:47',NULL,NULL,545,545,'99-5050  KN清洗挤压套装【易燃品！不发快递，只能发物流】',11400,9500,7500,191,6573,'http://www.51jiyou.com/upload/upload/202.jpg',0,'<p> <a href=\"http://www.knfilters.com/search/product.aspx?prod=99-5050\" target=\"_blank\">官网介绍http://www.knfilters.com/search/product.aspx?prod=99-5050</a></p> <p> 清洗方法如下： 1,将风格从空气滤槽中取出。 2,使用软毛刷将风格表面上的污垢扫除。 3,清除表面污垢后,用护理套装中的清洗剂(CLEANER),均匀喷洒于滤芯表面,只要覆盖均匀就好。 4,喷完后,将滤芯摆放于阴凉处,等待清洗液渗透。 5,大约10分钟,使用清水冲洗风格,从干净的一面往脏的一面冲掉污垢（注意只能使用普通自来水清洗,绝对不能使用高压水枪）。 6,冲洗后,可以手握风格甩掉大部分水,然后放置于阴凉处晾干（不能使用高压空气）。 7,晾干后,使用套装中的护理油(FILTER OIL)补充油份。将护理油涂抹于外层表面,均匀即可。 8,将附有护理油的风格晾干后,装回原车即可。</p> ',NULL,NULL,722,'套',99,0,0,0),
