(103,'2018-08-14 17:10:47',NULL,NULL,489,489,'安索合成多效润滑脂NLGI #1(GLBCR-CA)--414毫升',6500,5500,3800,0,20,'http://www.51jiyou.com/upload/upload/490.jpg',0,'<p> 安索GL系列润滑脂根据黏度级别分为#1和#2,分别对应名称为GLB及GLC。两款产品都适用于手动或者自动润滑系统。GLB更适用于在低温下具有长时间泵送操作的自动润滑系统适用以及齿轮箱的使用。正确黏度级别的安索多效润滑脂推荐用于重/轻负载的工厂生产领域,汽车应用领域,农业设备以及建筑设备的应用。 安索润滑脂产品与其他同类产品具有很好的兼容性。但是为了确保使用的效果,建议在使用安索产品之前,请将之前的润滑脂产品尽量清除干净。如有任何兼容性问题,请联系我们安索的产品代表或者直接联系安索官方。 在使用润滑脂的过程中,保持环境的清洁是至关重要的。使用之前,确保相关应用配件拭擦干净以防止污染。将轴承套件之间1/3到一半的空间填充润滑脂即可,以免过多使用导致热量积累。使用过程中应注意定期补充润滑脂。</p> ',NULL,NULL,450,'PCS',99,0,0,0),
