(109,'2018-08-14 17:10:47',NULL,NULL,544,544,'【易燃品！不发快递，只能发物流】安索MP金属保护剂(AMPSC)--248g',5000,4500,3500,8,426,'http://www.51jiyou.com/upload/upload/product/651.jpg',0,'<p> 安索MP是用以保护电器以及点火系统免受潮气,水分以及盐水侵蚀的理想选择。该产品也可以用于轻型武器以及相关精密设备的保护,不含硅树脂成分。安索MP与塑料,皮革,纤维,以及鱼线,油漆等等材质都具有良好的兼容性。</p> ',NULL,NULL,323,'PCS',99,0,0,0),
(110,'2018-08-14 17:10:47',NULL,NULL,495,495,' 【不备货，只预售】安索MP重负载金属保护剂 摩托车\\自行车链条油(AMHSC)--473毫升装',11800,9500,6800,1,1367,'http://www.51jiyou.com/upload/upload/product/653.jpg',0,'<p> 安索金属保护剂（MP）和安索重负载金属保护剂（MPHD）是应用便捷的喷涂式合成产品,用以保护金属表面,消除表面水分和减轻由于摩擦而发出的异响。</p> <p> 该产品可以穿透原本已经形成的锈蚀层从而恢复被锈蚀在一起的活动部件。MPHD通过在金属表面形成一层干的腊状膜来达到对金属的保护。不会形成粘性的泥状物质。</p> <p> 安索MP是用以保护电器以及点火系统免受潮气,水分以及盐水侵蚀的理想选择。该产品也可以用于轻型武器以及相关精密设备的保护,不含硅树脂成分。安索MP与塑料,皮革,纤维,以及鱼线,油漆等等材质都具有良好的兼容性。 安索MPHD用于对于重型负载操作下的金属表面的保护,以及对于经常暴露于潮气,盐水等等化学腐蚀品环境下金属的保护。对于铰链,钢索,弹簧,螺钉螺帽,摩托车自行车链条以及没有经过喷涂保护的轮辋等等金属部位的保护也是非常理想的产品。</p> <p> 性能特点 防止生锈与腐蚀,盐水中亦然 脱除金属表面水分 消除异响 润滑金属表面 形成干的,长效的类似腊状保护膜。 目前主要是作为摩托车和自行车链条油销售</p> ',NULL,NULL,550,'PCS',99,0,0,0),
