(113,'2018-08-14 17:10:47',NULL,NULL,545,545,'【不发快递，整箱发货】（请详细阅读产品说明）安索power foam积炭清洗、 强力泡沫清洁剂(APF)--510克装',9500,9000,5200,7456,80692,'http://www.51jiyou.com/upload/upload/674.jpg',0,'<p> <span style=\"font-size:16px;\"><span style=\"background-color:#ffff00;\">切勿使用在柴油发动机！</span></span><span style=\"font-size: 16px; background-color: rgb(255, 255, 0);\">危险品，只能整箱发物流。</span></p> <p> 一、产品介绍</p> <p> 安索强力泡沫（APF）可以清除引擎内的胶状物,漆膜以及积碳等污染物,提高引擎的性能及燃油经济性。该产品可以清洗进气阀,进气歧管,节流板等以确保燃烧进气系统能够最有效的工作。对于两冲程及四冲程引擎均适用。安索强力泡沫引擎清洗剂和脱油剂可以消除引擎异响保持汽化器及喷射系统的谐调工作。该产品对于燃油喷射起,催化转化器以及排放控制设备都是安全。不会影响破坏坏密封片,垫圈,橡胶以及塑料材质。</p> <p> &nbsp;</p> <p> 二、使用说明</p> <h3 style=\"color:red;\"> <span style=\"font-size:12px;\"><span style=\"color:#ff0000;\">1、特别注意事项</span></span></h3> <h3 style=\"color:red;\"> <span style=\"font-size:12px;\"><span style=\"color:#ff0000;\">A 别克车系除了凯越外，其他均不建议使用（有一定概率要原厂复位，复位费用较高）</span></span></h3> <h3 style=\"color:red;\"> <span style=\"font-size:12px;\"><span style=\"color:#ff0000;\">B 清洗节气门有灯亮概率的车型，使用本品，有一定概率会亮灯，没有故障灯消除能力的店家不建议使用；</span></span></h3> <h3 style=\"color:red;\"> <span style=\"font-size:12px;\"><span style=\"color:#ff0000;\">C &nbsp;欧系车建议使用挖煤标准流程清洗（火花塞及三元容易出故障，详细见后面说明）；</span></span></h3> <h3 style=\"color:red;\"> <span style=\"font-size:12px;\"><span style=\"color:#ff0000;\">D 清理气门室必须要慢、小心，清理完毕，必须确认气门室内没有留下残渣；</span></span></h3> <h3 style=\"color:red;\"> <span style=\"font-size:12px;\"><span style=\"color:#ff0000;\">E 公里数超过十万公里的，有一定概率三元催化会出故障，或者油泵堵塞，不建议清洗；</span></span></h3> <h3 style=\"color:red;\"> <span style=\"font-size:12px;\"><span style=\"color:#ff0000;\">F 清洗后有部分车型会出现怠速异常属于正常情形，通常跑一百公里会恢复，也可使用电脑复位；</span></span></h3> <h3 style=\"color:red;\"> <span style=\"font-size:12px;\"><span style=\"color:#ff0000;\">G &nbsp;喷入本品时请务必少量、匀速，不易大量打入！</span></span></h3> <p> &nbsp;</p> <p> 2、挖煤工序</p> <p> （在此，感谢江苏蜕变提供该工序）</p> <div> 安索节气门/APF深度挖煤清洗方法</div> <div> 材料准备：APF 原厂进气歧管垫 原厂喷油嘴维修包</div> <div> A 拆下节气门，进气歧管，用专用工具拆下喷油嘴，气门室导流板也拿下</div> <div> B 用APF对节气门清洗，进气歧管也喷入APF进行清洗，进气歧管的翻板处积碳一般都特别厉害</div> <div> C 喷油嘴，气门室导流板需要用APF进行浸泡</div> <div> D 气门室导流板浸泡后，用刀片慢慢刮下</div> <div> E 将清洗干净的进气歧管晾干，并将密封垫拆下，换上全新的原厂气门垫</div> <div> F 将喷油嘴的维修包拆开，将原喷油嘴上的密封圈等换掉</div> <div> G 确定将1和3缸或者2和4缸的气门处于关闭状态，喷入APF浸泡清洗&nbsp;</div> <div> &nbsp;</div> <div> &nbsp;</div> <div> 3、简易清洗工序</div> <div> &nbsp;</div> <div> （简易清洗工序，比较适合国产车、福特、本田、丰田、三菱低端车等中低端车，<span style=\"color: rgb(255, 0, 0);\">再次提醒：不建议欧系车使用简易清洗工序</span>）</div> <div> &nbsp;</div> <div> <div> A 冷车状态下需要启动引擎等待水温达到正常热车状态。(热车状态直接熄火即可），关闭发动机，卸掉空滤器总成或者拆掉节气门前段的胶管；</div> <div> B 拆下空气流量计插头 （没有空气流量计的车型跳过此步骤）；</div> <div> C 启动引擎，在引擎运转的情况下,保持转速1500-2000转，将一满罐该产品从节气门直接喷入进气歧管内部；</div> <div> D 将整瓶泡沫缓慢喷完后，可见节气门表面的的积碳被清除干净；</div> <div> E 关闭引擎，恢复发动机原状。10分钟后，重新启动引擎，原地空挡大脚油门踩至高转或者开动车辆高转运行，将沉积物从排气管排出。</div> <div> &nbsp;</div> </div> <p> 4、温馨提示</p> <p> &nbsp; &nbsp; &nbsp; &nbsp;该品可以当化油清洗剂使用，但深度清洗，需要有较强的动手能力和故障分析、判断、解决能力，因此不建议动手能力较弱的经销商使用。</p> <p> &nbsp;</p> <p> 5、关于烟雾大小的说明</p> <p> &nbsp;<span style=\"color: rgb(69, 69, 69); font-family: &quot;.PingFang SC&quot;;\">产生的烟的大小会因为</span><span class=\"s1\" style=\"color: rgb(69, 69, 69);\">APF</span><span style=\"color: rgb(69, 69, 69); font-family: &quot;.PingFang SC&quot;;\">的喷射</span><span class=\"s1\" style=\"color: rgb(69, 69, 69);\">\\</span><span style=\"color: rgb(69, 69, 69); font-family: &quot;.PingFang SC&quot;;\">燃烧的速度，发动机转速，发动机设计以及发动机积碳的多少，以及积碳组成和位置有关。烟雾排放的大小和清洗效果不是，完全相关的。</span></p> <p> p.p1 {margin: 0.0px 0.0px 0.0px 0.0px; font: 12.0px &#39;.PingFang SC&#39;; color: #454545} span.s1 {font: 12.0px &#39;Helvetica Neue&#39;}</p> <p> &nbsp;</p> ',NULL,NULL,650,'PCS',99,0,0,0),
(114,'2018-08-14 17:10:47',NULL,NULL,501,501,'【可积分兑换】安索展示架 机油货架 G3215',75000,75000,75000,14,1330,'http://www.51jiyou.com/upload/upload/product/675.jpg',0,'<p> &nbsp;</p> <p> <img alt=\"\" src=\"http://www.51jiyou.com/include/js/ckfinder/userfiles/images/2016/03/20160315_1746036115.jpg\" style=\"width: 750px; height: 1125px;\" /><img alt=\"\" src=\"http://www.51jiyou.com/include/js/ckfinder/userfiles/images/2016/03/20160315_1746125294.jpg\" style=\"width: 750px; height: 1125px;\" /></p> ',NULL,NULL,15000,'PCS',99,0,0,0),
(115,'2018-08-14 17:10:47',NULL,NULL,544,544,'【易燃品！不发快递，只能发物流】安索汽车漆面污渍去除剂 AMW（无水洗车）',9800,9800,5200,10,714,'http://www.51jiyou.com/upload/upload/product/679.jpg',0,'<p> Briteside无水清洗亮光剂（AMW）是一款干车情况下使用的清洗及光亮剂。具有快速起效,操作简易的特点。使用时仅需将产品喷在车上即可,然后用洁净绒布或毛巾将喷剂涂抹均匀,最后用另外干净的毛巾擦掉即可。该产品含有多种去除颗粒以及污垢的快速起效的表面活性剂,可以将污物悬浮脱离车子表面,从而起到将其除去的目的。同时还能够对车子表面形成一层保护,防止污物再度吸附在车上。提高车子耐污的能力,还可以有效地阻止紫外线对车子的影响。 Briteside无水清洗亮光剂（AMW）目前仅有一种产品形式即便捷式气雾喷剂,尚无其它使用方式的产品。该喷雾剂仅仅需要一条毛巾的配合就可以达到理想的效果,在您的爱车上会形成一层涂层,然后用干净毛巾将这层涂物擦掉,最终会使车子光亮异常还可以形成一层有效的保护膜。该清洗光亮剂的活性组分为特殊的表面活性剂,这种物质不仅仅能够使车体上的污染物脱离,还可以将它们保持悬浮状态,从而在擦拭的过程中将其除去。整个过程中,表面活性剂组分起到了一种隔离污染物与车体表面的作用,保护了车漆表面不被污染。但是,该产品不仅仅是具有清洗这一种功效。其含有的独特的抗静电剂可以防止灰尘及细小的泥土颗粒再度吸附到车上,在清洗完的很长时间内,都会让您的爱车光亮如新。同时,使用该产品还可以保护车辆少受紫外线的影响。 Briteside无水清洗亮光剂在所有的无孔的表面及尤其表面都有高效作用。在相应的场所,比如家庭,商店等等都可以使用该产品让您所清洁的物品保持光亮如新。</p> ',NULL,NULL,450,'PCS',99,0,0,0),
