(177,'2018-08-14 17:10:47',NULL,NULL,44,44,'安索合成抗磨损液压油(AWF05) ISO15--18.9升装',221800,214400,80000,0,1,'http://www.51jiyou.com/upload/upload/760.jpg',0,'<p> 安索合成AW系列抗磨损液压油剧具有剪切稳定性好,长效润滑的特点。这源自于安索独特的合成油技术以及最佳的添加剂系统,在高压高负载操作下保护液压系统连续工作。低温状态下依旧维持液态流动性。独特的抗磨损添加剂和防锈添加剂为您的设备提供了最佳的保护。出色的设计显著提高液压系统的工作效率。长效的寿命设计为您大大降低了维修以及劳动力成本。 延长换油周期,为您降低成本高压力系统中出色的抗磨损保护出色的防锈,抗氧化及抑制泡沫性能极端温度条件下依然可靠的保护显著提高液压系统的工作效率</p> ',NULL,NULL,18925,'桶',99,0,0,0),
(178,'2018-08-14 17:10:47',NULL,NULL,44,44,'安索全合成压缩机油ISO 32，SAE 10W(PSH05)--18.9升装',182500,176400,120000,1,0,'http://www.51jiyou.com/upload/upload/764.jpg',0,'<p> Synthetic Compressor Oil - ISO 32, SAE 10W 正确黏度级别的安索PC压缩机油被推荐用于单或双螺杆,叶片式,离心式以及往复活塞式压缩机曲柄轴及气缸,真空泵及其他比如齿轮,轴承,风机,泵和气动工具的应用。在压缩机应用领域,更换周期为8,000小时甚至可以更长。需要注意的是换油周期与使用条件和保养状况紧密相关的。建议根据油样分析来决定。为确保最好的应用效果,安索推荐在使用该产品前,将压缩机原来使用的油品全部换出。如果压缩机内部已经有积碳,请按照压缩机生产商的指导将其去除。</p> ',NULL,NULL,19000,'PCS',99,0,0,0),
