(228,'2018-08-14 17:10:47',NULL,NULL,474,469,'【易燃品！不发快递，只能发物流】安索柴油浓缩喷油嘴清洁剂(ADFCN)--473毫升装',8000,7000,4800,180,9065,'http://www.51jiyou.com/upload/upload/909.jpg',0,'<div> <p> <span style=\"color:#ff0000;\">有237ML小包装产品上线，更适合销售。产品代码ADFPCN。</span></p> <p> &nbsp;</p> <p> ADFCN--喷油嘴清洁剂</p> <p> 作用</p> <p> 1、清洗喷油嘴</p> <p> 2、提高燃油经济性，节油4.5%</p> <p> 3、去除柴油中的水份</p> <p> 用量</p> <p> 一瓶（473ml）可以兑300L柴油</p> <p> 初次使用可以增加浓度，增加清洗效果。建议每次使用，以获得最佳性能和保护，防止燃油泵磨损，喷油器的磨损和喷射器沉积。</p> <p> &nbsp;</p> <p> 目前在销售的柴油添加剂有三款</p> <p> ADFCN--柴油喷油嘴清洗剂:侧重清洗喷油嘴</p> <p> ACBCN--柴油油品提升剂:侧重提高柴油品质</p> <p> ACFCN--柴油抗冻剂：能降低柴油凝固定15℃</p> </div> <div> <div> &nbsp;</div> <div> <p style=\"margin: 0px; padding: 0px; font-family: Verdana, 宋体, Tahoma, Helvetica, Arial, sans-serif; background-color: rgb(252, 253, 253);\"> 系统有提供计量瓶供采购。</p> <p style=\"margin: 0px; padding: 0px; font-family: Verdana, 宋体, Tahoma, Helvetica, Arial, sans-serif; background-color: rgb(252, 253, 253);\"> 链接如下：</p> <p style=\"margin: 0px; padding: 0px; font-family: Verdana, 宋体, Tahoma, Helvetica, Arial, sans-serif; background-color: rgb(252, 253, 253);\"> <a href=\"http://www.51jiyou.com/product/goods_view.php?is_package=n&amp;product_id=677\" style=\"margin: 0px; padding: 0px; color: rgb(51, 102, 204); text-decoration: none; cursor: pointer;\" target=\"_blank\">http://www.51jiyou.com/product/goods_view.php?is_package=n&amp;product_id=677</a></p> <p style=\"margin: 0px; padding: 0px; font-family: Verdana, 宋体, Tahoma, Helvetica, Arial, sans-serif; background-color: rgb(252, 253, 253);\"> &nbsp;</p> <p style=\"margin: 0px; padding: 0px; font-family: Verdana, 宋体, Tahoma, Helvetica, Arial, sans-serif; background-color: rgb(252, 253, 253);\"> <img alt=\"\" src=\"http://www.51jiyou.com/upload/upload/product/677.jpg\" style=\"margin: 0px; padding: 0px; width: 350px; height: 350px;\" /></p> <p style=\"margin: 0px; padding: 0px; font-family: Verdana, 宋体, Tahoma, Helvetica, Arial, sans-serif; background-color: rgb(252, 253, 253);\"> &nbsp;</p> <p style=\"mar