(1815,'2018-08-14 17:10:47',NULL,NULL,482,482,'E-0773',59000,49100,36600,0,10,'http://www.51jiyou.com/upload/upload/product/8323.jpg',0,'<h1 style=\"color: blue; text-align: center;\"> 用在奥迪上是非原装位的改装，请参考下作业</h1> <p> &nbsp;</p> <h3 style=\"margin: 0px; padding: 0px; font-size: 12px; color: blue; font-family: Verdana, 宋体, Tahoma, Helvetica, Arial, sans-serif;\"> <span style=\"font-size:20px;\"><span style=\"margin: 0px; padding: 0px;\">&nbsp;因06年奥迪A6L&nbsp;3.0原车款KN风格已经停产，也没有专用的进气套件，于是研究直接改冬菇头，量原车与空滤盒接头口径为92.5MM，上官网查数据E-0773内径为92MM，插上以后松紧合适，简直就是原配<img alt=\"yes\" height=\"20\" src=\"http://www.51jiyou.com/include/js/ckeditor/plugins/smiley/images/thumbs_up.gif\" style=\"margin: 0px; padding: 0px;\" title=\"yes\" width=\"20\" /><img src=\"file:///C:/Users/ADMINI~1/AppData/Local/Temp/TempPic/(T%7BA26X7J)E1AHYAV4@ZSEF.tmp\" style=\"margin: 0px; padding: 0px;\" />，至于固定问题就太简单了，淘宝上10元一个的卡箍支架直接来3个，两个用来E-0773，另一个用来固定62-1130（俗称废气冬菇），原车废气管口径与KN62-1130近似，缠上5圈绝缘胶带直接插上就行，非常的紧，支架的固定位置可根据个人爱好自定义，防水罩用的RX-4990DK，整个安装过程非常简单，安装位置和距离合适，很多人看后以为专车专用的，这里的说一个注意问题，就是一定要把原车空滤箱上面的二次补气阀拆下来随便找个不碍事的位置固定上就好了，改装完成后车正常行驶两千多公里，动力提升明显，无任何故障码及不良反应（因无人赞助马力机，具体提升多少马力未知<img alt=\"smiley\" height=\"20\" src=\"http://www.51jiyou.com/include/js/ckeditor/plugins/smiley/images/regular_smile.gif\" style=\"margin: 0px; padding: 0px;\" title=\"smiley\" width=\"20\" />）。</span></span><img alt=\"\" src=\"http://www.51jiyou.com/include/js/ckfinder/userfiles/images/2014/10/20141006_2155589577.JPG\" style=\"margin: 0px; padding: 0px; width: 1600px; height: 900px;\" /><img alt=\"\" src=\"http://www.51jiyou.com/include/js/ckfinder/userfiles/images/2014/10/20141006_2156248715.JPG\" style=\"margin: 0px; padding: 0px; width: 1600px; height: 900px;\" /><img alt=\"\" src=\"http://www.51jiyou.com/include/js/ckfinder/userfiles/images/2014/10/20141006_2156487537.JPG\" style=\"margin: 0px; padding: 0px; width: 1600px; height: 900px;\" /><img alt=\"\" src=\"http://www.51jiyou.com/include/js/ckfinder/userfiles/images/2014/10/20141006_2157086368.JPG\" style=\"margin: 0px; padding: 0px; width: 1600px; height: 900px;\" /><img alt=\"\" src=\"http://www.51jiyou.com/include/js/ckfinder/userfiles/images/2014/10/20141006_2157274919.JPG\" style=\"margin: 0px; padding: 0px; width: 1600px; height: 900px;\" /><img alt=\"\" src=\"http://www.51jiyou.com/include/js/ckfinder/userfiles/images/2014/10/20141006_2157436589.JPG\" style=\"margin: 0px; padding: 0px; width: 1600px; height: 900px;\" /></h3> <p> <a href=\"http://www.knfilters.com/search/product.aspx?prod=E-0773\" target=\"_blank\">官网介绍http://www.knfilters.com/search/product.aspx?prod=E-0773</a></p> ',NULL,NULL,631,'PCS',99,0,0,0),
